@P2P-ftw: Normally I work with uTorrent on my PC, but since this download is so big I had to use my Multimedia Device from Traxdata.
It supports resume though, but you can't simply change directories within the torrent client of that device, it's just plain awful to work with.
But hey, it's less energy consuming then downloading it via my PC 24/7. ;-)

